/** @format */

import React from "react";
import ListGroup from "react-bootstrap/ListGroup";
import Todo from "./Todo";
export default function TodosList() {
  const [todos, setTodos] = React.useState([
    { id: 1, name: "todo1" },
    { id: 2, name: "todo2" },
    { id: 3, name: "todo3" },
  ]);
  return (
    <div className="mt-3">
      <ListGroup as="ol" numbered>
        {todos.map((ele) => (
          <Todo data={ele} />
        ))}
      </ListGroup>
    </div>
  );
}
